import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";



function Datas() {

  const [nasa, setNasa] = useState(null);
  useEffect(() => {
    axios.get("https://api.nasa.gov/planetary/apod")
      .then(response => {
        console.log(response.data)
      })
      .catch(error => {
        console.log("error")
      })
  })
}



export default  Da
